import React from 'react'
import styled from 'styled-components'

const Styles = styled.div`

    .container {
        width: 100%;
        height: 100%;
        background-color: #476099;
    }

    .content {
        position: relative;
        top: 0;
        left: 0;
        bottom:0;
        right:0;
      }
    
    .title {
        color: white;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        text-align: center;
        font-Size: 35px;
        letter-spacing: 3px;
    }
`;

const ProjectsPage = () => {
    return (
        <Styles>
            <div className="container">
                <div className="content">
                    <p className="title">PROJECTS</p>
                    <ul id="projectsList">
                        <li>
                            <ul id="magicianList">
                                <li>Magician</li>
                                <li>August 2018 - Present</li>
                                <li>Developing a video game with a select group of students using Unity and C#</li>
                            </ul>
                        </li>
                        <li>
                            <ul id="swampHacks2019List">
                                <li>SwampHacks 2019</li>
                                <li>January 2019</li>
                                <li>36 hour coding marathon in which groups of students collaborate in software development</li>
                                <li>Led a team of students to create a game to teach financial literacy in a fun, intuitive way using Java</li>
                            </ul>
                        </li>
                        <li>
                            <ul id="workProjectsList">
                                <li>Work-related projects</li>
                                <ul id="intelWebDevelopment">
                                    <li>Cyber Security Portal Interface</li>
                                    <li>May 2019 - August 2019</li>
                                    <li>Full stack web development handling information pipeline to help enable SDL automation for business group</li>
                                    <li>Created visualizations of data to </li>
                                    <li>SKILLS: UX, React, JS, HTML, CSS, C#, ASP.NET Core</li>
                                </ul>
                                <ul id="intelAI">
                                    <li>Machine Learning Project</li>
                                    <li>May 2019 - August 2019</li>
                                    <li>Using multi-class classification text classification to categorize a database of web-scraped cyber security news articles for proactive security group.</li>
                                    <li>SKILLS: Python, Keras, Tenforflow, Pandas, Spacy, Movidius, PySpark, More??</li>
                                </ul>
                            </ul>
                        </li>
                        <li>
                            <ul id="Misc. Projects">
                                <li>Assembled my own gaming computer in June 2016: https://pcpartpicker.com/user/alliewolf/saved/#view=qvNXsY</li>
                                <li>Built scratching posts for my cats :)</li>
                                <li>Fixed school's raspberry pi based tardy system using google cloud admin</li>
                                <li>Developed AR iOS application using XCode</li>
                                <li>Created an architectural model of school library using Core Draw and a laser cutter</li>
                                <li>This website!</li>
                            </ul>
                        </li>
                    </ul>
                </div>
            </div>
        </Styles>
    )
}

export default ProjectsPage;
